import { ThemeProvider } from "@emotion/react";
import { Copyright, Label, PhotoCamera } from "@mui/icons-material";
import ListAltIcon from '@mui/icons-material/ListAlt';
import { CssBaseline, AppBar, Toolbar, Typography, Box, Container, Stack, Button, Grid, Card, CardMedia, CardContent, CardActions, createTheme, makeStyles, TextField, Paper, IconButton } from "@mui/material";
import React, { FC, useState } from "react";
import { RouteComponentProps } from "react-router-dom";
import {useQuery} from 'react-query'
import axios from 'axios'
import AddIcon from '@mui/icons-material/Add';
import Avatar from '@mui/material/Avatar';
import styled from "@emotion/styled";
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';


const theme = createTheme();


type TasksComponentProps = RouteComponentProps;
const Tasks: FC<TasksComponentProps> = ({ history }) => {

  const config = {
      headers: { Authorization: `Bearer ${localStorage.getItem("auth")}` }
  };

  const logout = () => {
    localStorage.clear();
    history.push("/login");
  };

  async function fetchTasks(){
    const {data} = await axios.get(`https://localhost:7008/api/Task/TaskList?id=${localStorage.getItem("id")}`, config)    
    return data
  }
    
  const {data, error, isError, isLoading } = useQuery('posts', fetchTasks) 

  if(isLoading){
      return <div>Loading...</div>
  }
  if(isError){
      return <div>Error!</div>
  }
  const StyledPaper = styled(Paper)(({ theme }) => ({
    maxWidth: 700
  }))
  
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
        <ListAltIcon sx={{ mr: 2 }} />
        <Typography variant="h6" color="inherit" noWrap  sx={{ flexGrow: 1 }}>
            To Do List
          </Typography>
          <Button color="inherit" onClick={logout}>Log Out</Button>
        </Toolbar>
      </AppBar>
      <main>
        <Box
          sx={{
            bgcolor: 'background.paper',
            pt: 8,
            pb: 6,
          }}
        >
          <Container maxWidth="sm">
            <Typography
              component="h1"
              variant="h2"
              align="center"
              color="text.primary"
              gutterBottom
            >
              Hello {localStorage.getItem("username")}👋
            </Typography>
            <Typography variant="h5" align="center" color="text.secondary" paragraph>
              You currently have {data.length} active tasks.
            </Typography>
            <Stack
              sx={{ pt: 4 }}
              direction="row"
              spacing={2}
              justifyContent="center"
            >
              <Grid container spacing={1}>
                <Grid item xs={9}>
                <TextField
                  margin="normal"
                  variant="filled"
                  fullWidth
                  required
                  id="todo"
                  label="Todo description"
                  autoComplete="todo"
                  autoFocus
                />
                </Grid>
                <Grid item xs={3}>
                  <Button variant="contained" startIcon={<AddIcon />} style={{margin:"18px 0 0 10px", height: "65%"}}>
                  Add
                </Button>
                </Grid>
              </Grid>
              
             
            </Stack>
          </Container>
        </Box>
        <Container sx={{ py: 8 }} maxWidth="md">



    <Box sx={{ flexGrow: 1, overflow: 'hidden', px: 3 }}>

      {/* <StyledPaper
        sx={{
          my: 1,
          mx: 'auto',
          p: 2,
        }}
      >
        <Grid container spacing={2} wrap="nowrap">
          <Grid item xs={12}>
            <h5 style={{width:"100%"}}>Customized asdas</h5>
          </Grid>
          
            <Grid item xs>
              <Typography noWrap>In publishing and graphic design, demonstrate the</Typography>
            </Grid>
            <Grid item>
            <IconButton color="primary" aria-label="Delete" component="label">
              <input hidden accept="image/*" type="file" />
              <DeleteForeverIcon />
            </IconButton>
            </Grid>
        </Grid>
      </StyledPaper> */}

<Paper
      sx={{
        p: 2,
        margin: 'auto',
        maxWidth: 650,
        flexGrow: 1,
        backgroundColor: (theme) =>
          theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
      }}
    >
      <Grid container spacing={2}>
        <Grid item xs={12} sm container>
          <Grid item xs container direction="column" spacing={2}>
            <Grid item xs>
              <Typography variant="body2" gutterBottom>
                Full resolution 1920x1080 • JPEG Full resolution 1920x1080 • JPEGFull resolution 1920x1080 • JPEGFull resolution 1920x1080 • JPEGFull resolution 1920x1080 • JPEG
              </Typography>
            </Grid>
            <Grid item>
              <Typography sx={{ cursor: 'pointer' }} variant="body2">
                Remove
              </Typography>
            </Grid>
          </Grid>
          <Grid item>
            <Typography variant="body2" color="text.secondary">
                Creation Date: 11.01.2022
            </Typography>
          </Grid>
        </Grid>
      </Grid>
    </Paper>

    </Box>

        </Container>
      </main>
    </ThemeProvider>
  );
}

export default Tasks;
